/** Keys for a specific namespace */
export type KeysOf<NS extends Namespace> = keyof NamespaceKeys[NS] & string;

/** Keys that don't require params for a single namespace */
type _KeysWithoutParams<NS extends Namespace> = {
  [K in keyof NamespaceKeys[NS]]: NamespaceKeys[NS][K] extends undefined ? K : never;
}[keyof NamespaceKeys[NS]] &
  string;

/** Keys that don't require params - distributes over union of namespaces */
export type KeysWithoutParams<NS extends Namespace> = NS extends Namespace ? _KeysWithoutParams<NS> : never;

/** Keys that require params for a single namespace */
type _KeysWithParams<NS extends Namespace> = {
  [K in keyof NamespaceKeys[NS]]: NamespaceKeys[NS][K] extends undefined ? never : K;
}[keyof NamespaceKeys[NS]] &
  string;

/** Keys that require params - distributes over union of namespaces */
export type KeysWithParams<NS extends Namespace> = NS extends Namespace ? _KeysWithParams<NS> : never;

/** Prefixed translation key (e.g., 'auth:password', 'common:cancel') */
export type PrefixedKey<NS extends Namespace = Namespace> = `${NS}:${KeysOf<NS>}`;

/** Prefixed keys that don't require params */
export type PrefixedKeyWithoutParams<NS extends Namespace = Namespace> = `${NS}:${KeysWithoutParams<NS>}`;

/** Prefixed keys that require params */
export type PrefixedKeyWithParams<NS extends Namespace = Namespace> = `${NS}:${KeysWithParams<NS>}`;

/** Default namespace keys (unprefixed) */
export type DefaultKey = KeysOf<"translation">;

/** All valid translation keys */
export type TranslationKey = DefaultKey | PrefixedKey;

/** Extract namespace from a prefixed key */
type ExtractNamespace<K extends string> = K extends `${infer NS}:${string}` ? NS : never;

/** Extract key part from a prefixed key */
type ExtractKey<K extends string> = K extends `${string}:${infer Key}` ? Key : K;

/** Get params type for a key within a specific namespace */
export type ParamsFor<NS extends Namespace, K extends string> =
  K extends KeysOf<NS>
    ? NamespaceKeys[NS][K]
    : K extends PrefixedKey
      ? ExtractNamespace<K> extends Namespace
        ? ExtractKey<K> extends KeysOf<ExtractNamespace<K>>
          ? NamespaceKeys[ExtractNamespace<K>][ExtractKey<K>]
          : never
        : never
      : never;
